import React from "react";
import ReactDOM from "react-dom";
import styled from "@emotion/styled";

const Header = styled.div`
  color: red;
  background-color: blue;
`;

ReactDOM.render(
  <h1>
    <Header>hi</Header>
    Hello, world!
  </h1>,
  document.getElementById("root")
);
console.log("Hello, world!");
